import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login/index.jsx';
import DashBoard from './pages/Dashboard/index.jsx';
// import SafetyDigitilization from './pages/SafetyDigitilization/index.jsx';
import WorkPermit from './pages/WorkPermits/index.jsx';
import Modules from './pages/Modules/index.jsx';
import SingleWorkPermit from './pages/WorkPermits/SingleWorkPermit.jsx';
// import AllKySheets from './pages/AllKYSheets/index.jsx';
import MainLayout from './components/mainLayout/index.jsx';


function AppRoutes() {
    return (
        <>
            <Router>
                <Routes>
                    <Route path="/" element={<Login />} />
                    <Route
                            path="module"
                            element={<Modules />}  
                        />
                    <Route element={<MainLayout />}>
                        <Route
                            path="dashboard"
                            element={<DashBoard />}
                        />
                        <Route
                            path="work-permit"
                            element={<WorkPermit />}
                        />
                        <Route
                            path="work-permit/:id"
                            element={<SingleWorkPermit />}  
                        /> 
                        <Route
                            path="mainPage"
                            element={<SingleWorkPermit />}  
                        />
                    </Route>


                </Routes>

            </Router>
        </>
    );
}

export default AppRoutes
